import Web3 from 'web3';

const httpProvider = new Web3.providers.HttpProvider("https://mainnet.infura.io/v3/9aa3d95b3bc440fa88ea12eaa4456161");
const getETHWeb3 = () => {
    const web3 = new Web3(httpProvider);
    return web3;
}

const currentProvider = new Web3.providers.HttpProvider("https://binance.nodereal.io");
const getBSCWeb3 = () => {
    const web3 = new Web3(currentProvider);
    return web3;
}

export default getETHWeb3;
